  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className="App">
        <IsbarFhirClientProvider>
          <h1>The app is open.</h1>
          {/* This is where the patient information will be displayed*/}
          {/* <PatientInfoField /> */}
          {/* <ISBARSimpleInputField /> */}

        </IsbarFhirClientProvider>
      </div>
    )
  }
}

export default App;
